import { Injectable } from '@angular/core';

@Injectable({
  providedIn: 'root'
})
export class StudioLibPrefixedService {

  constructor() { }
}
import { Component, OnInit } from '@angular/core';

@Component({
  selector: 'st-custom-input',
  templateUrl: './custom-input.component.html',
  styleUrls: ['./custom-input.component.css']
})
export class CustomInputComponent implements OnInit {

  constructor() { }

  ngOnInit(): void {
  }

}
<p>custom-input works!</p>
import { Component, OnInit } from '@angular/core';

@Component({
  selector: 'st-studio-lib-prefixed',
  template: `
    <p>
      studio-lib-prefixed works!!!!
    </p>
    <st-custom-input></st-custom-input>
  `,
  styles: [
  ]
})
export class StudioLibPrefixedComponent implements OnInit {

  constructor() { }

  ngOnInit(): void {
  }

}
import { NgModule } from '@angular/core';
import { StudioLibPrefixedComponent } from './studio-lib-prefixed.component';
import { CustomInputComponent } from './custom-input/custom-input.component';



@NgModule({
  declarations: [
    StudioLibPrefixedComponent,
    CustomInputComponent
  ],
  imports: [
  ],
  exports: [
    StudioLibPrefixedComponent,
    CustomInputComponent
  ]
})
export class StudioLibPrefixedModule { }
/*
 * Public API Surface of studio-lib-prefixed
 */

export * from './lib/studio-lib-prefixed.service';
export * from './lib/studio-lib-prefixed.component';
export * from './lib/studio-lib-prefixed.module';

export * from './lib/custom-input/custom-input.component';
